import React, {useEffect, useState} from 'react'
import { Table, InputGroup, Form, Container} from 'react-bootstrap/Table';
import 'bootstrap/dist/css/bootstrap.min.css';

function App(){

  const [backendData, setBackendData] = useState([])

  useEffect(() => {
    fetch("/api")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setBackendData(data)
      })
  }, [])

  return (
    <div className='App'>
      <Container>

      </Container>
        <h1 className='text-center mt-4'>Powerlifting Meets</h1>
        <Table>
          <thead>
            <th>
              <th>Name</th>
              <th>Event Details</th>
              <th>When</th>
              <th>Where</th>
            </th>
          </thead>
          <tbody>
            <tr>
              <td>Santa Cruz Ball</td>
              <td>lifting with 60 people</td>
              <td>March 13, 2023</td>
              <td>Santa Cruz, CA</td>
            </tr>
          </tbody>
        </Table>
    </div>
  )
}


export default App
